import { StyleSheet } from "react-native";

export default StyleSheet.create({
    body: {
        display: 'flex',
        alignItems: 'center',
    },
    header: {
        marginTop: 20,
        fontSize: 20,
        fontWeight: 'bold',
    },
    inputs:{
        marginTop: 50,
    }
})
